"""## Components of an Streamlit App

There are core components, which you can clone using the starter app on Github  https://github.com/streamlit/app-starter-kit?ref=blog.streamlit.io

What we will do are two things:
1. change the requirement.txt to include langchain and openai in order to run our code
2. modify the streamlit_app.py (code below) in order to create our chatbot
"""

with open("streamlit-app.py", "w") as f:
  f.write("""
import streamlit as st
from langchain.llms import OpenAI
st.title('ðŸ¦œðŸ”— Quickstart App')

openai_api_key = st.sidebar.text_input('OpenAI API Key')

def generate_response(input_text):
  llm = OpenAI(temperature=0.7, openai_api_key=openai_api_key)
  st.info(llm(input_text))

with st.form('my_form'):
  text = st.text_area('Enter text:', 'What are the three key pieces of advice for learning how to code?')
  submitted = st.form_submit_button('Submit')
  if not openai_api_key.startswith('sk-'):
    st.warning('Please enter your OpenAI API key!', icon='âš ')
  if submitted and openai_api_key.startswith('sk-'):
    generate_response(text)

    """)

"""## Deploy the app
Deploying the app is super simple:



1.   Create a Github account
2. Create a GitHub repository for the app.
3. Use the Streamlit starter code https://github.com/streamlit/app-starter-kit?ref=blog.streamlit.io and create a new respository
4.   Download the file from Google Colab and Upload the file to the new Github, overriding the streamlit_app.py
5. make changes in the requirement.txt and include

  streamlit

  openai

  langchain


  in the requirement list
6. Go to Streamlit and sign up / log in for an account https://share.streamlit.io/
7.  Connect Github to Streamlit
8.  In Streamlit Community Cloud, click the New app button, Select Github, then specify the repository, branch, and main file path.
9. Click the Deploy! button.

Once you deploy, you will need your open-ai-api in order to use the app

# You try

with the code below we can deploy a ChatGPT mimic. Can you deploy the app?

if there is error, did you try to change the requirements.txt to include

langchain

openai

streamlit

?
"""

with open("streamlit_app.py", "w") as f:
  f.write("""
import streamlit as st
from langchain.chat_models import ChatOpenAI
from langchain.chains import LLMChain
from langchain.prompts import PromptTemplate
from langchain.memory import ConversationBufferWindowMemory

st.title("ChatGPT Clone")
prompt = PromptTemplate(
    input_variables=["chat_history", "question"],
    template='''You are a very kind and friendly AI assistant. You are
    currently having a conversation with a human. Answer the questions
    in a kind and friendly tone with some sense of humor.

    chat_history: {chat_history},
    Human: {question}
    AI:'''
)
openai_api_key = st.sidebar.text_input('OpenAI API Key')
if not openai_api_key.startswith('sk-'):
    st.warning('Please enter your OpenAI API key!', icon='âš ')
if openai_api_key.startswith('sk-'):
    llm = ChatOpenAI(openai_api_key=openai_api_key)
    memory = ConversationBufferWindowMemory(memory_key="chat_history", k=4)
    llm_chain =  LLMChain(
    llm=llm,
    memory=memory,
    prompt=prompt
    )

    # check for messages in session and create if not exists
    if "messages" not in st.session_state.keys():
        st.session_state.messages = [
            {"role": "assistant", "content": "Hello there, am ChatGPT clone"}
        ]

    # Display all messages
    for message in st.session_state.messages:
        with st.chat_message(message["role"]):
            st.write(message["content"])

    user_prompt = st.chat_input()

    if user_prompt is not None:
        st.session_state.messages.append({"role": "user", "content": user_prompt})
        with st.chat_message("user"):
            st.write(user_prompt)

    if st.session_state.messages[-1]["role"] != "assistant":
        with st.chat_message("assistant"):
            with st.spinner("Loading..."):
                ai_response = llm_chain.predict(question=user_prompt)
                st.write(ai_response)
        new_ai_message = {"role": "assistant", "content": ai_response}
        st.session_state.messages.append(new_ai_message)

""")

